    assert(lua_gettop(L) == 3);

    /* local d = x[2 + 1] */
    lua_pushnumber(L, 3);
    lua_gettable(L, 2);
    assert(lua_gettop(L) == 4);

    /* x[1 + 1] = force_all_rec(a) */
    lc_getupvalue(L, lua_upvalueindex(1), 0, 51);
    lua_pushvalue(L, 3);
    lua_call(L, 1, 1);
