/* name: set_last
 * function(lst) */
static inline int lcf1_set_last(lua_State *L) {
  enum { lc_nformalargs = 1 };
  lua_settop(L, 1);

  /* if ret == HOLE then */
  enum { lc719 = 1 };
  lc_getupvalue(L, lua_upvalueindex(1), 1, 164);
  lc_getupvalue(L, lua_upvalueindex(1), 2, 163);
  const int lc720 = lua_equal(L, -2, -1);
  lua_pop(L, 2);
  lua_pushboolean(L, lc720);
  const int lc721 = lua_toboolean(L, -1);
  lua_pop(L, 1);
  if (lc721) {

    /* ret = lst */
    lua_pushvalue(L, 1);
    lc_setupvalue(L, lua_upvalueindex(1), 1, 164);
    assert(lua_gettop(L) == 1);

    /* return */
    return 0;
    assert(lua_gettop(L) == 1);
  }
  lua_settop(L, lc719);
  assert(lua_gettop(L) == 1);

  /* local x = ret */
  lc_getupvalue(L, lua_upvalueindex(1), 1, 164);
  assert(lua_gettop(L) == 2);

  /* while true do */
  enum { lc722 = 2 };
  while (1) {
    lua_pushboolean(L, 1);
    if (!(lua_toboolean(L, -1))) {
      break;
    }
    lua_pop(L, 1);

    /* if not construction_p(x) then */
    enum { lc723 = 2 };
    lc_getupvalue(L, lua_upvalueindex(1), 22, 84);
    lua_pushvalue(L, 2);
    lua_call(L, 1, 1);
    lua_pushboolean(L, !(lua_toboolean(L, -1)));
    lua_remove(L, -2);
    const int lc724 = lua_toboolean(L, -1);
    lua_pop(L, 1);
    if (lc724) {

      /* return LANG_ERROR() */
      const int lc725 = lua_gettop(L);
      lc_getupvalue(L, lua_upvalueindex(1), 22, 99);
      lua_call(L, 0, LUA_MULTRET);
      return (lua_gettop(L) - lc725);
      assert(lua_gettop(L) == 2);
    }
    lua_settop(L, lc723);
    assert(lua_gettop(L) == 2);

    /* local d = construction_tail(x) */
    lc_getupvalue(L, lua_upvalueindex(1), 22, 82);
    lua_pushvalue(L, 2);
    lua_call(L, 1, 1);
    assert(lua_gettop(L) == 3);

    /* if d == HOLE then */
    enum { lc726 = 3 };
    lc_getupvalue(L, lua_upvalueindex(1), 2, 163);
    const int lc727 = lua_equal(L, 3, -1);
    lua_pop(L, 1);
    lua_pushboolean(L, lc727);
    const int lc728 = lua_toboolean(L, -1);
    lua_pop(L, 1);
    if (lc728) {

      /* break */
      break;
      assert(lua_gettop(L) == 3);
    }
    lua_settop(L, lc726);
    assert(lua_gettop(L) == 3);

    /* x = construction_tail(x) */
    lc_getupvalue(L, lua_upvalueindex(1), 22, 82);
    lua_pushvalue(L, 2);
    lua_call(L, 1, 1);
    lua_replace(L, 2);
    assert(lua_gettop(L) == 3);

    /* internal: stack cleanup on scope exit */
    lua_pop(L, 1);
  }
  lua_settop(L, lc722);
  assert(lua_gettop(L) == 2);

  /* if not construction_p(x) then */
  enum { lc729 = 2 };
  lc_getupvalue(L, lua_upvalueindex(1), 22, 84);
  lua_pushvalue(L, 2);
  lua_call(L, 1, 1);
  lua_pushboolean(L, !(lua_toboolean(L, -1)));
  lua_remove(L, -2);
  const int lc730 = lua_toboolean(L, -1);
  lua_pop(L, 1);
  if (lc730) {

    /* return LANG_ERROR() */
    const int lc731 = lua_gettop(L);
    lc_getupvalue(L, lua_upvalueindex(1), 22, 99);
    lua_call(L, 0, LUA_MULTRET);
    return (lua_gettop(L) - lc731);
    assert(lua_gettop(L) == 2);
  }
  lua_settop(L, lc729);
  assert(lua_gettop(L) == 2);

  /* if construction_tail(x) ~= HOLE then */
  enum { lc732 = 2 };
  lc_getupvalue(L, lua_upvalueindex(1), 22, 82);
  lua_pushvalue(L, 2);
  lua_call(L, 1, 1);
  lc_getupvalue(L, lua_upvalueindex(1), 2, 163);
  const int lc733 = lua_equal(L, -2, -1);
  lua_pop(L, 2);
  lua_pushboolean(L, lc733);
  lua_pushboolean(L, !(lua_toboolean(L, -1)));
  lua_remove(L, -2);
  const int lc734 = lua_toboolean(L, -1);
  lua_pop(L, 1);
  if (lc734) {

    /* return LANG_ERROR() */
    const int lc735 = lua_gettop(L);
    lc_getupvalue(L, lua_upvalueindex(1), 22, 99);
    lua_call(L, 0, LUA_MULTRET);
    return (lua_gettop(L) - lc735);
    assert(lua_gettop(L) == 2);
  }
  lua_settop(L, lc732);
  assert(lua_gettop(L) == 2);

  /* x[2 + 1] = lst */
  lua_pushvalue(L, 1);
  lua_pushnumber(L, 3);
  lua_insert(L, -2);
  lua_settable(L, 2);
  assert(lua_gettop(L) == 2);
  return 0;
}

